import React from 'react'

const Profile = () => {
  return (
    <div>
          <h2>Profile</h2>
      {token && <button onClick={fetchProfile}>Fetch Profile</button>}
      {profileData && <pre>{JSON.stringify(profileData, null, 2)}</pre>}
      
    </div>
  )
}

export default Profile
